import React, { Component } from 'react';

class A extends Component{
    constructor(props) {
        super(props);
        this.state = {
           header: "Tugas Akhir",
           isi: "kel 9"
        }
     }
     componentDidMount() {         
        alert(`Tugas Akhir Kelompok 9`)   
    }
     render() {
        return (
           <div>
           <center>
               
              <h1>{this.state.header}</h1>
              <h2>{this.state.isi}</h2>
           </center>
           </div>
        );
     }
}

export default A;
